import React from 'react'
import LiquorCategory from './LiquorCategory'

function Cart( savedItems) {
  return (
    <div className='component cart'>
        <p className='first'> View Saved Items</p>
        <LiquorCategory props = {savedItems} />        
    </div>
  )
}

export default Cart
